import Plate from '../../images/hero.jpg';
import './product.css';

const Product = () => {

    const food =[
        {id:1, foodname: 'Plate', image:Plate, Price: '$5'},
        {id:2, foodname: 'Plate', image:Plate, Price: '$5'},
        {id:3, foodname: 'Plate', image:Plate, Price: '$5'},
        {id:4, foodname: 'Plate', image:Plate, Price: '$5'}
    ]
    return(
        <div>
            <h1>View Products</h1>

            <p>These are the available food.</p>
            <div classname='cards'>
                {
                    // if food is available run the next set of functions, if not don't run
                    food && food.map((food)=> 
                        <div className='cardbox'>
                            <img src={food.image} alt="" />
                            
                            <p>{food.foodname}</p>
                            <p>{food.price}</p>

                        </div>
                     )
                }
            </div>
        </div>
    )
}
export default Product
